"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[500],{162:function(c,b,a){a.d(b,{Z:function(){return e}});var d=a(5893);function e(){return(0,d.jsx)("div",{className:"w-full h-full bg-gray-400 rounded-2xl animate-pulse"})}},3510:function(b,a){a.Z=[{filters:["shooting","multiplayer","fighting","unity"],path:"rs",link:"rooftop-snipers",img:"rooftop.jpg",name:"Rooftop Snipers",dev:"Pat Eichler",desc:"Rooftop Snipers is a chaotic two button local multiplayer game. Challenge your friends side by side or play the computer. Shoot your opponent off the map to win.",controls:["W/I: Jump","E/O: shooting"]},{filters:["multiplayer","unity"],path:"tj",link:"tube-jumpers",img:"tj.jpg",name:"Tube Jumpers",dev:"Pat Eichler",desc:"Tube Jumpers is local multiplayer game with your friends packed with action. The last one to stay on the tubes wins. Watch out for miscellaneous objects while watching your back from other players.",controls:["W/I: Jump"]},{filters:["platformer","unity"],path:"slope",link:"slope",img:"slope.jpg",name:"Slope",dev:"Rob Kay",desc:"Slope is the ultimate running game that will put your skills to the test. Speed down on a randomized slope. The farther you go, the faster your ball travels. This game might look simple but playing this will give you extreme adrenaline rush. Just remember to avoid obstacles and those red blocks. Always be on track to get a high score and you might have your name on the leaderboard!",controls:["AD/QE/Arrow Keys: Control movement"]},{filters:["multiplayer","shooting","fighting","unity"],path:"gs",link:"getaway-shootout",img:"getaway-shootout.jpg",name:"Getaway Shootout",dev:"Pat Eichler",desc:"Race on top of a moving train in Getaway Shootout and be the first to grab 3 getaways. Compete against computer AI or with a friend in 2 player mode to prove who is the best. There are many weapons and power-ups you can collect throughout the map use it wisely to to gain an upper hand over your opponents.",controls:["W/E (P1): Jump left/right","R (P1): Power up","I/O (P2): Jump left/right","P (P2): Power up",]},{filters:["multiplayer"],path:"eaglercraft",link:"eaglercraft",img:"eaglercraft.png",name:"Eaglercraft",dev:"LAX1DUDE",desc:"Eaglercraft is real Minecraft 1.5.2 that you can play in any regular web browser. That includes school chromebooks, it works on all chromebooks. You can join real Minecraft 1.5.2 servers with it through a custom proxy based on Bungeecord.\n    \n    Use fullscreen to get around the scroll bug.",controls:["Controls can be modified ingame"]},{filters:["miscellaneous","puzzle","mobile"],path:"2048",link:"2048",img:"2048.png",name:"2048",dev:"Gabriele Cirulli",desc:"2048 is a single-player sliding block puzzle game. Use your arrow keys to move the tiles. When two tiles with the same number touch, they merge into one!",controls:["WASD/Arrow Keys: Move tiles","R: Restart"]},{filters:["emulator"],path:"",link:"emulatorjs",img:"ejs.png",name:"EmulatorJS",dev:"ethanobrien",desc:"The original decompilation of emulatorjs. Retroarch in your browser! Upload your own ROMS to play!",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["shooting","multiplayer","fighting","flash"],path:"gm",link:"gun-mayhem",img:"gunmayhem.jpg",name:"Gun Mayhem",dev:"Kevin Gu",desc:"Gun Mayhem is an extremely interesting flash format shooting game developed by Kevin Gu. The game is designed with 10 maps starting from prehistoric context to modern times. The player's task in this game is to destroy all enemies by shooting them down! Very simple, isn't it! Let's start the adventure now!",controls:["WASD/Arrow Keys: Control movement","Z/T: shooting","X/Y: Throw bomb",]},{filters:["shooting","multiplayer","fighting","flash"],path:"gm2",link:"gun-mayhem-2",img:"gunmayhem2.jpg",name:"Gun Mayhem 2",dev:"Kevin Gu",desc:"More explosive arena style action! Battle against the AI or with friends in this cartoony platform shooter. Up to 4 players can play at once! \n    Gun Mayhem returns with brand new maps, and much more:\n    - New campaign with 16 progressively challenging missions\n    - Challenge levels to test your skills\n    - 7 custom game modes\n    - New guns, perks, and customization options",controls:["WASD/Arrow Keys: Control movement","Z/T: shooting","X/Y: Throw bomb",]},{filters:["shooting","multiplayer","fighting","flash"],path:"gmr",link:"gun-mayhem-redux",img:"gunmayhemredux.jpg",name:"Gun Mayhem Redux",dev:"Kevin Gu",desc:"Gun Mayhem Redux which is the brand new chapter of Gun Mayhem, is now available. This chapter is little bit different compared to other chapters. For instance, game characters and war maps is minimized little bit to have a better view and game play but this doesn't cause the loose of excitement of the this superb game. \n    In this chapter, tens of brand new weapons will be awaiting you. Even, you will have a chance to war by using primitive weapons. The war resumes in the arena with the superior war maps and weapons and entertaining chapters!",controls:["WASD/Arrow Keys: Control movement","Z/T: shooting","X/Y: Throw bomb",]},{filters:["platformer"],path:"run3",link:"run-3",img:"run3.jpg",name:"Run 3",dev:"Player03",desc:"There\u2019s a whole new galaxy waiting to be explored! You can play Run 3 in the Explore Mode and the Infinite Mode. To add more levels to your Galaxy Map, choose the Explore Mode. The Runner will encounter lots of new tunnels and areas, and may bump into some friends along the way!\n    If the game is stuck on the loading screen and not loading, try disabling your adblocker.",controls:["WASD/Arrow Keys: Control movement","R: Reset","P: Pause"]},{filters:["puzzle"],path:"tetris",link:"tetris",img:"tetris.jpg",name:"Tetris",dev:"Kyle Shanks",desc:"Tetris is a tile-matching video game created by Russian software engineer Alexey Pajitnov in 1984. It has been published by several companies, most prominently during a dispute over the appropriation of the rights in the late 1980s.",controls:["\u2190/\u2192 Arrow Keys: Move horizontally","\u2191: Rotate piece","\u2193: Soft Drop","P: Pause","Shift: Switch blocks","Space: Hard drop","R: Reset",]},{filters:["sports"],path:"rb",link:"retro-bowl",img:"retrobowl.jpg",name:"Retro Bowl",dev:"New Star Games",desc:"Retro Bowl is an American style football game created by New Star Games. Are you ready to manage your dream team into victory? Be the boss of your NFL franchise, expand your roster, take care of your press duties to keep your team and fans happy.",controls:["WASD/Arrow Keys: Control movement","Mouse: Drag to throw"]},{filters:["shooting","flash"],path:"zomb",link:"zombocalypse",img:"zombocalypse.jpg",name:"Zombocalypse",dev:"John Funtanilla",desc:"Only you, and a whole lot of hungry hungry zombies. Fortunately, you get constant airdrops to deliver fresh weapons and med kits. Now, if you can only live long enough to earn some achievements and unlock some bigger guns. When things get really hairy, call in an airstrike!",controls:["AD/\u2190 \u2192: Control movement","S/\u2193: Pick up items","W/\u2191: Call airstrike","Space: Attack","Shift: Pause game",]},{filters:["platformer","emulator"],path:"sm64.z64",link:"super-mario-64",img:"sm64.jpeg",core:"n64",name:"Super Mario 64",dev:"Nintendo",desc:"Super Mario 64 is a 1996 platform game for the Nintendo 64 and the first Super Mario game to feature 3D gameplay. It was developed by Nintendo EAD and published by Nintendo.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["miscellaneous","unity"],path:"adofai",link:"adofai",img:"adofai.png",name:"A Dance of Fire and Ice",dev:"7th Beat Games",desc:"A Dance of Fire and Ice is a strict rhythm game.\n  \n    Keep your focus as you guide two orbiting planets along a winding path without breaking their perfect equilibrium.\n    \n    Press on every beat of the music to move in a line.\n    \n    Every pattern has its own rhythm to it. It can get difficult. This game is purely based on rhythm, so use your ears more than your sight.\n\n    Check out the full game on Steam:\n    https://store.steampowered.com/app/977950/A_Dance_of_Fire_and_Ice/",controls:["Use any keys to play"]},{filters:["driving","unity"],path:"msc2",link:"madalin-stunt-cars-2",img:"msc2.jpg",name:"Madalin Stunt Cars 2",dev:"Madalin Games",desc:"Welcome to the expansive open world of Madalin Stunt Cars 2. Pick your car and drift, drag and race your way through three massive fully explorable maps.\n\n    Jump behind the wheel of the hottest supercars on the planet, race through cities and execute trick stunts with the sensational Madalin Stunt Cars 2.\n    \n    Pick a Huracan, LaFerrari, Pagani or Veneno and tear up the streets. Compete in multiplayer arenas with other MSC2 gamers.",controls:["WASD/Arrow Keys: Control movement","Shift: Nitrous","R: Respawn","T: Open map","C: Change camera",]},{filters:["shooting","unity"],path:"superhot",link:"superhot",img:"superhot.jpg",name:"SUPERHOT",dev:"SUPERHOT Team",desc:"No regenerating health bars. No conveniently placed ammo drops. \n    It's just you, outnumbered and outgunned, grabbing weapons off fallen enemies to shoot, slice, and maneuver through a hurricane of slow-motion bullets.",controls:["WASD/Arrow Keys: Control movement","Space: Jump","LMB: Shoot",]},{filters:["platformer","shooting","flash"],path:"mfp",link:"my-friend-pedro",img:"mfp.jpg",name:"My Friend Pedro",dev:"Dead Toast Entertainment",desc:"An action packed slow motion face-blasting-simulator about friendship and imagination.",controls:["WASD/Arrow Keys: Control movement","Mouse: shooting","Shift/Space: Slow down time",]},{filters:["idle","miscellaneous","mobile"],path:"cc",link:"cookie-clicker",img:"cookie-clicker.jpg",name:"Cookie Clicker",dev:'Julien "Orteil" Thiennot',desc:"Cookie Clicker is a game about making an absurd amount of cookies. To help you in this endeavor, you will recruit a wide variety of helpful cookie makers, like friendly Grandmas, Farms, Factories, and otherworldly Portals.",controls:["Click: Interact"]},{filters:["platformer"],path:"dj",link:"doodle-jump",img:"doodle.jpg",name:"Doodle Jump",dev:"Lima Sky",desc:"Doodle Jump is a fun and cute game. Your must help our alien jump as high as possible onto a range of different hand-drawn platforms. This game is an endless game, so you must simply keep jumping and try to register as high a score as you possibly can!",controls:["Arrow Keys: Control movement","Space: Start/Restart game"]},{filters:["miscellaneous","mobile"],path:"snake",link:"snake",img:"snake.jpg",name:"Snake",dev:"Google",desc:"How long can you last before your tail becomes your dinner? Take the challenge and eat all those apples! Be careful not to hit the wall!",controls:["WASD/Arrow Keys: Control movement","R: Restart"]},{filters:["miscellaneous","puzzle","mobile"],path:"solitaire",link:"solitaire",img:"solitaire.png",name:"Solitaire",dev:"Google",desc:"Patience, card solitaire or just solitaire, is a genre of card games that can be played by a single player. Patience games can also be played in a head-to-head fashion with the winner selected by a scoring scheme.",controls:["Click: Interact"]},{filters:["miscellaneous","puzzle"],path:"adr",link:"a-dark-room",img:"adr.png",name:"A Dark Room",dev:"Doublespeak Games",desc:"A Dark Room is a minimalist text-based adventure RPG game right in your browser! How far will you go, player?",controls:["Click: Interact"]},{filters:["platformer","emulator"],path:"smasmw.smc",link:"smasmw",img:"smasmw.png",name:"Super Mario Allstars + Super Mario World",core:"snes",dev:"Nintendo",desc:"Super Mario All-Stars + Super Mario World is a compilation title for the Super Nintendo Entertainment System. It includes all the games from Super Mario All-Stars, as well as Super Mario World. It was released in December 1994 in North America, 1995 in Europe, and was never released in Japan.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["puzzle","miscellaneous"],path:"align4",link:"align-4",img:"align4.jpg",name:"Align 4",dev:"Will Boyd",desc:"Align 4 is a two-player connection board game just like Connect 4, in which the players choose a color and then take turns dropping colored discs into a seven-column, six-row vertically suspended grid. The pieces fall straight down, occupying the lowest available space within the column. \n    The objective of the game is to be the first to form a horizontal, vertical, or diagonal line of four of one's own discs. The first player can always win by playing the right moves.",controls:["Click: Interact"]},{filters:["platformer"],path:"pacman",link:"pacman",img:"pacman.jpg",name:"Pac-Man",dev:"Bandai Namco, Shaun Williams",desc:"Pac-Man is a Japanese video game franchise published, developed and owned by Bandai Namco Entertainment.",controls:["Arrow Keys: Control movement"]},{filters:["platformer","unity"],path:"econ",link:"economical",img:"economical.png",name:"Economical",dev:"baba_s",desc:"2D puzzle action game where saving coins is important! Aiming for a goal using items. Make a way with blocks. Break a block with a hammer. But you need coins.",controls:["A/D: Control movement","W/Space: Jump","Mouse Wheel: Select items",]},{filters:["platformer","unity"],path:"econ2",link:"economical-2",img:"economical2.png",name:"Economical 2",dev:"baba_s",desc:"Version 2 of the 2D puzzle action game where saving coins is important! Aiming for a goal using items. Make a way with blocks. Break a block with a hammer. But you need coins.",controls:["A/D: Control movement","W/Space: Jump","Mouse Wheel: Select items",]},{filters:["platformer","mobile"],path:"coloron",link:"color-on",img:"coloron.png",name:"COLORON",dev:"Greg Hovanesyan",desc:"COLORON is a fun and well-designed platformer. The goal is to match the color of the tower to the bouncing ball. Keep it going for as long as you can, just don't get mad.",controls:["Click: Interact"]},{filters:["platformer","flash"],path:"meatboy",link:"meat-boy",img:"meatboy.jpg",name:"Meat Boy",dev:"Team Meat",desc:"This is NOT Super Meat Boy!\n\n    Its simply the flash prototype that Super Meat Boy was based off of.\n    SMB, will play very differently and is 100% new.. what im saying is if you even slightly enjoy the prototype, you will LOVE SMB!\n    \n    For more info on Super Meat Boy check out supermeatboy.com\n    \n    -Team Meat",controls:["\u2190/\u2192: Control movement","Space: Jump"]},{filters:["miscellaneous"],path:"fnf",link:"fnf",img:"fnf.png",name:"Friday Night Funkin",dev:"ninjamuffin99",desc:'Friday Night Funkin\' is an open-source donationware rhythm game first released in 2020 for a game jam. \n    The game was developed by a team of four Newgrounds users, Cameron "Ninjamuffin99" Taylor, David "PhantomArcade" Brown, Isaac "Kawai Sprite" Garcia, and evilsk8r.',controls:["WASD/Arrow Keys: Interact","+/-: Change volume"]},{filters:["platformer"],path:"spelunky",link:"spelunky",img:"spelunky.png",name:"Spelunky",dev:"Derek Yu",desc:"Spelunky is a cave exploration / treasure-hunting game inspired by classic platform games and roguelikes, where the goal is to grab as much treasure from the cave as possible. \n    Every time you play the cave's layout will be different. Use your wits, your reflexes, and the items available to you to survive and go ever deeper! \n    Perhaps at the end you may find what you're looking for...",controls:["\u2190/\u2192: Control movement","\u2191: Look up/climb","\u2193: Look down/Crouch/Climb/Run","X: Action","Z: Jump","C: Cycle Item","Shift: Run",]},{filters:["platformer","multiplayer","fighting","flash"],path:"ssf",link:"ssf",img:"ssf.png",name:"Super Smash Flash",dev:"McLeodGaming",desc:"Choose your characters and options and battle it out with 28 different characters in the original title that started it all \u2013 Super Smash Flash!\n    This award-winning Super Smash Bros. Fangame is complete with Classic Mode, Adventure Mode, and all of the things that make Smash Bros. \n    Feel like Smash Bros, with characters and content you\u2019d never expect sprinkled about. Have fun!",controls:["Arrow Keys/WASD: Control movement","O/G: Jump","P/F: Attack","Backspace: Pause",]},{filters:["puzzle","miscellaneous","mobile"],path:"wordle",link:"wordle-unlimited",img:"wordle.png",name:"Wordle Unlimited",dev:"Josh Wardle",desc:"Wordle is a web-based word game developed by Welsh-born software engineer Josh Wardle. Players have six attempts to guess a five-letter word; feedback is given for each guess, in the form of colored tiles, indicating when letters match or occupy the correct position. This tweak has no limit to how many games you can play!",controls:["Type to interact"]},{filters:["sports"],path:"bbstars",link:"basketball-stars",img:"bbstars.png",name:"Basketball Stars",dev:"MadPuffers",desc:"Basketball Stars is a 2-player basketball game created by Madpuffers. You can play solo or with a friend as a variety of legendary basketball players. \n    Shoot basketball with the likes of LeBron James, James Harden, and Stephen Curry in Basketball Stars!",controls:["WASD/Arrow Keys: Control movement","B/L: Shoot/Steal","S/\u2193: Pump fake/block","Double-Tap A/D/\u2190/\u2192: Sprint","V/K: Super shot",]},{filters:["sports","fighting","emulator"],path:"sf2.sfc",link:"streetfighter2",img:"sf2.jpg",name:"Street Fighter 2",core:"snes",dev:"Capcom",desc:"Street Fighter II: The World Warrior is a competitive fighting game originally released for the arcades in 1991. It is the second entry in the Street Fighter series and the arcade sequel to the original Street Fighter released in 1987. It was Capcom's fourteenth title that ran on the CP System arcade hardware. Street Fighter II improved upon the many concepts introduced in the first game, including the use of command-based special moves and a six-button configuration, while offering players a selection of multiple playable characters, each with their own unique fighting style.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"alttp.smc",link:"a-link-to-the-past",img:"alinktothepast.jpg",name:"Legend of Zelda: A Link to the Past",core:"snes",dev:"Nintendo",desc:"Return to an age of magic and heroes! When an evil magician named Agahnim begins kidnapping young maidens in Hyrule in a quest to break the imprisoning seal on Ganon, a young boy named Link is called upon to stop him. \n    Link must venture into twisting mazes, dungeons, palaces and shadowy forests as he searches for the maidens and Princess Zelda. Traversing both Light and Dark Worlds, he must navigate eight dark dungeons, fighting evil enemies and huge bosses. \n    Help our hero prevent Ganon and Agahnim from shattering Hyrule forever. Whether you are a young knight, a heroine-in-training or a seasoned warrior, The Legend of Zelda: A Link to the Past will delight!",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"sonic1.smd",link:"sonic-1",img:"sonic1.jpg",name:"Sonic 1",core:"segaMD",dev:"Sega, Sonic Team",desc:"Sonic the Hedgehog is a Japanese video game series and media franchise created and owned by Sega. The franchise follows Sonic, an anthropomorphic blue hedgehog who battles the evil Doctor Eggman, a mad scientist.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"sonic2.smd",link:"sonic-2",img:"sonic2.jpg",name:"Sonic 2",core:"segaMD",dev:"Sega, Sonic Team",desc:"Sonic the Hedgehog 2 is a 1992 platform game developed and published by Sega for the Sega Genesis. It follows Sonic as he attempts to stop Doctor Robotnik from stealing the Chaos Emeralds to power his space station, the Death Egg.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"dkc.sfc",link:"dkc",img:"dkc.jpg",name:"Donkey Kong Country",core:"snes",dev:"Rare, Nintendo",desc:"Donkey Kong Country is a side-scrolling platform game in which the player must complete 40 levels to recover the Kongs' banana hoard, which has been stolen by the crocodilian Kremlings.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","puzzle","flash"],path:"blox",link:"bloxorz",img:"bloxorz.jpg",name:"Bloxorz",dev:"Damian Clarke",desc:"Bloxorz is a brain twisting puzzle game of rolling blocks and switching bridges. You'll be rolling round in circles over the course of the 33 levels.",controls:["WASD/Arrow Keys: Control movement"]},{filters:["platformer","multiplayer"],path:"fbwg1",link:"fbwg1",img:"fbwg1.jpg",name:"Fireboy and Watergirl 1",dev:"Oslo Albet",desc:"Fireboy and Watergirl 1 is the first cooperative platformer game in the Fireboy and Watergirl series. In this adventure, you explore 32 levels of the Forest Temple, controlling both the Fireboy and Watergirl characters through various puzzles.",controls:["WASD/Arrow Keys: Control movement"]},{filters:["platformer","unity"],path:"tr",link:"tunnelrush",img:"tunnelrush.jpg",name:"Tunnel Rush",dev:"Deer Cat",desc:"Tunnel Rush online is the ultimate 3D single-player experience. Blaze your way through caves and tunnels. Each Tunnel Rush level drops you into a whirling kaleidoscope of hazards and 3D tunnels. Play Tunnel Rush to dodge barriers using just your wits and your keyboard.",controls:["AD/Arrow Keys: Control movement","Space: Pause/Restart"]},{filters:["flash","strategy"],path:"btd",link:"btd",img:"btd.jpg",name:"Bloons Tower Defense",dev:"Ninja Kiwi",desc:"Bloons Tower Defense. Stop any bloons from escaping the maze by building and upgrading bloons popping towers. Towers can throw darts, tacks, bombs, and ice.",controls:["Click: Interact"]},{filters:["platformer","flash"],path:"fr2",link:"flood-runner-2",img:"fr2.jpg",name:"Flood Runner 2",dev:"Ben Rad Vinyl",desc:"A fast paced run-for-your-life game.\n\n    Goal is to outrun the giant wave and survive. This game is played with only one button, get your timing right and set a top score!",controls:["Click/Space: Jump/glide"]},{filters:["emulator","platformer","shooting"],path:"megaman.nes",link:"megaman",img:"megaman.png",name:"Mega Man",core:"nes",dev:"Capcom",desc:'Mega Man, known as Rockman in Japan, is a Japanese science fiction video game franchise created by Capcom, starring a series of robot characters each known by the moniker "Mega Man".',controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","platformer","shooting"],path:"megaman2.nes",link:"megaman-2",img:"megaman2.jpg",name:"Mega Man 2",core:"nes",dev:"Capcom",desc:"Mega Man 2 is an action game developed and published by Capcom for the Nintendo Entertainment System.\n    Mega Man 2 continues Mega Man's battle against the evil Dr. Wily and his rogue robots.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","platformer","shooting"],path:"metroid.nes",link:"metroid",img:"metroid.jpg",name:"Metroid",core:"nes",dev:"Nintendo",desc:"Metroid is a Japanese action-adventure game franchise created by Nintendo. \n    The player controls bounty hunter Samus Aran, who protects the galaxy from Space Pirates and other malevolent forces and their attempts to harness the power of the parasitic Metroid creatures.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","platformer","shooting"],path:"metroid2.gb",link:"metroid-2",img:"metroid2.jpg",name:"Metroid II",core:"gb",dev:"Nintendo",desc:"Metroid II: Return of Samus is an action-adventure game developed and published by Nintendo for the Game Boy.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","platformer"],path:"sonic3.smd",link:"sonic-3-knuckles",img:"sonic3-knuckles.png",name:"Sonic 3 & Knuckles",core:"segaMD",dev:"Sega",desc:"Dr. Eggman\u2019s (AKA Dr. Robotnik\u2019s) Death Egg was once again blasted by Sonic, crash-landing on the peak of a volcano on the Floating Island. \n    Dr. Eggman is still at large, and Sonic can\u2019t allow him to get his hands on the Master Emerald and repair the Death Egg.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","driving"],path:"mk64.z64",link:"mariokart64",img:"mariokart64.png",name:"Mario Kart 64",core:"n64",dev:"Nintendo",desc:"Mario Kart 64 is a 1996 kart racing video game developed and published by Nintendo for the Nintendo 64. \n    The game is the second entry in the Mario Kart series and is the successor to Super Mario Kart for the Super Nintendo Entertainment System.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["puzzle","miscellaneous"],path:"ting",link:"thereisnogame",img:"thereisnogame.jpg",name:"There Is No Game",dev:"KaMiZoTo",desc:"There is no game. There is nothing to do.\n\n    Do not click or tap anywhere. Really. DO NOT CLICK OR TAP ANYWHERE.\n    \n    Do not laugh as there is nothing to laugh about.",controls:["Mouse: Interact"]},{filters:["platformer","flash"],path:"unfairmario",link:"unfairmario",img:"unfairmario.jpg",name:"Unfair Mario",dev:"Gameitnow",desc:"It is Super Mario, again. Our beloved little fellow is inviting you to travel alongside him throughout the Unfair Mario game. You will find yourself in the classic arcade game, but this time, with a little twist. \n    Some traps will be trickier, and some obstacles harder to overcome. But you will survive it, will you not? ",controls:["Arrow Keys: Control movement"]},{filters:["platformer"],path:"gdr",link:"geometry-dash-remastered",img:"gdr.jpg",name:"Geometry Dash Remastered",dev:"Arabask",desc:"Welcome all to Geometry Dash Remastered, and, well, you already know the game. But this is more, this is 5 new levels you can't find anywhere else, this is ... REMASTERED (I'm totally serious).\n    \n    Warning: This game may be resource intensive",controls:["W/Space/Click/\u2191: Jump","Esc/P: Pause"]},{filters:["idle","miscellaneous"],path:"ht",link:"hackertyper",img:"hackertyper.jpg",name:"Hacker Typer",dev:"David M.",desc:"Created in 2011, Hacker Typer arose from a simple desire to look like the stereotypical hacker in movies and pop culture. Since that time, it has brought smiles to millions of people across the globe. \n    Plus, many of you have temporarily transformed into hackers yourselves, all from a few clicks on the keyboard (and some programming magic behind the scenes!).",controls:["Click or type to play"]},{filters:["platformer","flash"],path:"fpa",link:"fancy-pants-adventures",img:"fancy-pants-adventures.png",name:"Fancy Pants Adventures",dev:"DrNeroCF",desc:"Run Fast, Run Fancy.",controls:["\u2190/\u2192: Control movement","\u2193: Duck/roll","\u2191: Enter door","S: Jump",]},{filters:["fighting","flash","strategy"],path:"aow",link:"age-of-war",img:"age-of-war.jpg",name:"Age of War",dev:"Louissi",desc:"Take control of 16 different units and 15 different turrets to defend your base and destroy your enemy.\n    In this game, you start at the cavern men's age, then evolve! There is a total of 5 ages, each with its units and turrets. I hope you have fun with this game! Sooo many hours of hard work.",controls:["Click: Interact"]},{filters:["platformer","flash"],path:"sm63",link:"super-mario-63",img:"sm63.png",name:"Super Mario 63",dev:"Runouw",desc:"Super Mario 63 is a fan-game inspired by Nintendo's Super Mario 64. Many levels and features are based upon it and other of Nintendo's games, but a variety of them are completely original. \n    Among them include a detailed storyline, ability to play as Luigi, a highly customizable Level Designer with sharable codes, three different FLUDD Power-ups, four different power-caps, and 64 Shine Sprites & 64 Star Coins to collect.",controls:["Arrow Keys: Control movement","Z: Interact/stomultiplayer","X: Twirl","C: Launch from cannons",]},{filters:["platformer","emulator"],path:"pokered.gb",link:"pokemon-red",img:"pokemon-red.jpg",name:"Pokemon Red",core:"gb",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon Red and Pok\xe9mon Blue introduce legions of gamers to the world of Kanto, where the likes of Charmander, Pikachu, and Mewtwo were first discovered. Through exciting exploration, battles, and trades, Trainers are able to access 150 Pok\xe9mon. You begin your journey in Pallet Town as a young boy.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokeblue.gb",link:"pokemon-blue",img:"pokemon-blue.jpg",name:"Pokemon Blue",core:"gb",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon Red and Pok\xe9mon Blue introduce legions of gamers to the world of Kanto, where the likes of Charmander, Pikachu, and Mewtwo were first discovered. Through exciting exploration, battles, and trades, Trainers are able to access 150 Pok\xe9mon. You begin your journey in Pallet Town as a young boy.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokefire.gba",link:"pokemon-firered",img:"pokemon-firered.jpg",name:"Pokemon Fire Red",core:"gba",dev:"Nintendo,  Game Freak",desc:"Pok\xe9mon FireRed Version and Pok\xe9mon LeafGreen Version are 2004 remakes of the 1996 Game Boy role-playing video games Pok\xe9mon Red and Blue.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokeleaf.gba",link:"pokemon-leafgreen",img:"pokemon-leafgreen.jpg",name:"Pokemon Leaf Green",core:"gba",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon FireRed Version and Pok\xe9mon LeafGreen Version are 2004 remakes of the 1996 Game Boy role-playing video games Pok\xe9mon Red and Blue.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokeruby.gba",link:"pokemon-ruby",img:"pokemon-ruby.jpg",name:"Pokemon Ruby",core:"gba",dev:"Nintendo, Game Freak",desc:"Immerse yourself in the beautiful region of Hoenn, a place of masterful heroes and mysterious teams, of friendship and battles. As the new kid in town, you set off your journey as a Pok\xe9mon Trainer. Who knows what wonders and dangers await you? Now it's time to grab your gear and head out on your own...",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokesapp.gba",link:"pokemon-sapphire",img:"pokemon-sapphire.jpg",name:"Pokemon Sapphire",core:"gba",dev:"Nintendo, Game Freak",desc:"Immerse yourself in the beautiful region of Hoenn, a place of masterful heroes and mysterious teams, of friendship and battles. As the new kid in town, you set off your journey as a Pok\xe9mon Trainer. Who knows what wonders and dangers await you? Now it's time to grab your gear and head out on your own...",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokeem.gba",link:"pokemon-emerald",img:"pokemon-emerald.jpg",name:"Pokemon Emerald",core:"gba",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon Emerald Version takes Trainers back to the land of Hoenn for an expanded adventure, this time against both Team Magma and Team Aqua! Pok\xe9mon Emerald also features an even more exciting storyline featuring the Legendary Rayquaza.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokegold.gbc",link:"pokemon-gold",img:"pokemon-gold.jpg",name:"Pokemon Gold",core:"gb",dev:"Nintendo, Game Freak",desc:"Enter a whole new world, with new Pok\xe9mon to capture, train and battle! Meet Professor Elm and get the all-new Pok\xe9 Gear, including map, radio, cell phone and clock. Set the clock then watch as day turns to night and events take place in real time\u2014 and be sure to keep an eye out for Pok\xe9mon that come out only at night!",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokesilv.gbc",link:"pokemon-silver",img:"pokemon-silver.jpg",name:"Pokemon Silver",core:"gb",dev:"Nintendo, Game Freak",desc:"Enter a whole new world, with new Pok\xe9mon to capture, train and battle! Meet Professor Elm and get the all-new Pok\xe9 Gear, including map, radio, cell phone and clock. Set the clock then watch as day turns to night and events take place in real time\u2014 and be sure to keep an eye out for Pok\xe9mon that come out only at night!",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"smb.nes",link:"smb",img:"smb.jpg",name:"Super Mario Bros",core:"nes",dev:"Nintendo",desc:"Mario Bros. is a 1983 platform game developed and published for arcades by Nintendo. \n    It was designed by Shigeru Miyamoto and Gunpei Yokoi, Nintendo's chief engineer. \n    Italian plumber Mario and his twin brother Luigi exterminate creatures emerging from the sewers by knocking them upside-down and kicking them away.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","flash"],path:"dl",link:"duck-life",img:"ducklife.png",name:"Duck Life",dev:"Wix Games",desc:"A pet raising simulation. Train a duckling to become a racing duck.\n    \n    Invest your time and money to raise and train the duckling properly.\n    Run, swim, and fly your way to be the champion racer, and save your farm!",controls:["Arrow Keys: Control movement"]},{filters:["platformer","flash"],path:"dl2",link:"duck-life-2",img:"ducklife2.png",name:"Duck Life 2",dev:"Wix Games",desc:"A pet raising simulation. Train a duckling to become a racing duck.\n    \n    Invest your time and money to raise and train the duckling properly.\n    Run, swim, and fly your way to be the champion racer, and save your farm!",controls:["Arrow Keys: Control movement"]},{filters:["platformer","flash"],path:"dl3",link:"duck-life-3",img:"ducklife3.png",name:"Duck Life 3",dev:"Wix Games",desc:"The latest installment of the Duck Life franchise is here! Train your little duck into a lean, mean, racing machine. Practice running, swimming, flying, and climbing to work your way to the top. \n    Compete in different competitions, chow down on some seed to gain up energy, then see if your duck can come out on top!",controls:["Arrow Keys: Control movement"]},{filters:["platformer","flash"],path:"dl4",link:"duck-life-4",img:"ducklife4.png",name:"Duck Life 4",dev:"Wix Games",desc:"Ducklife 4 is here, so get ready to race your ducks! In the near future, genetically engineered ducks have been banned from the races. It's up to you to make an elite duck who is capable of winning any race!\n    Go through vigorous training sequences to build up speed and agility! Do you have the skills to win against all the other ducks? Good luck!",controls:["Arrow Keys: Control movement"]},{filters:["miscellaneous","fighting"],path:"sf",link:"sans-fight",img:"sans-fight.jpg",name:"Sans Fight",dev:"Jcw87",desc:'Undertale Sans Fight Clone; "do you wanna have a bad time? \'cause if you visit this page... you are REALLY not going to like what happens next."',controls:["WASD/Arrow Keys: Control movement","Z: Proceed"]},{filters:["sports","multiplayer","emulator"],path:"nbajam.sfc",link:"nba-jam",img:"nbajam.png",name:"NBA Jam",core:"snes",dev:"Iguana Entertainment",desc:"NBA Jam is a classic arcade basketball game developed and published back in 1993 and is the first entry to the NBA Jam series. \n    The game features 2 on 2 basketball match off and is one of the first sports games to feature real and digitized NBA-licensed teams and players!",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["sports","multiplayer","emulator"],path:"nbajamte.smc",link:"nba-jam-tournament-edition",img:"nbajamtournament.png",name:"NBA Jam Tournament Edition",core:"snes",dev:"Iguana Entertainment",desc:"NBA Jam Tournament Edition is the second game in the basketball arcade series created by Midway. \n\n    The game features two-on-two fast paced matches with real life NBA players from the 1993-1994 seasons. \n\n    The game has over 120 NBA athletes plus more than 40 hidden characters to unlock.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["sports","multiplayer","emulator"],path:"nbajam2k20.smc",link:"nba-jam-2k20",img:"nbajam2k20.png",name:"NBA Jam 2K20",core:"snes",dev:"Iguana Entertainment",desc:"NBA Jam 2K20: Tournament Edition is a ROM hack of the game NBA Jam: Tournament Edition for the Super Nintendo Entertainment System (SNES). \n		This hack did not change the core aspects, as well as most game mechanics, of the game, and instead worked on updating its player and team roster to match the 2019-2020 NBA season.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","shooting","flash"],path:"rw",link:"raftwars",img:"raftwars.jpg",name:"Raft Wars",dev:"Martijn Kunst",desc:"Fight against the pirates in the raft wars and win the treasure in the game. The two heroes have cannons which can shoot very far. However this requires a very accurate shooting. Aim well and hit all the pirates in order to win the game.",controls:["Mouse: shooting"]},{filters:["platformer","shooting","flash"],path:"rw2",link:"raftwars2",img:"raftwars2.jpg",name:"Raft Wars 2",dev:"Martijn Kunst",desc:"Fight in the raft wars and hit all the targets to sabotage the business of the complex and get back the treasure that is buried in the ground. Defeat all enemies and pass all levels in the game. In the end you can submit your game score.",controls:["Mouse: shooting"]},{filters:["platformer","flash"],path:"alienhom",link:"alien-hominid",img:"alien-hominid.png",name:"Alien Hominid",dev:"The Behemoth",desc:"Alien Hominid is a side-scrolling shooter in a similar vein to games such as Metal Slug, where one hit instantly kills and has a two-player simultaneous play. \n    Players take over as the titular hominid, who has to fend off waves of secret agents. \n    His main arsenal is a blaster, while players can also melee close-up enemies and use a limited number of grenades to attack. \n    Advanced moves include rolling under shots, jumping on and biting off enemies' heads, temporarily scaring other enemies, and digging underground to drag enemies down with them.",controls:["Arrow Keys: Control movement","A: shooting","S: Jump"]},{filters:["platformer","emulator"],path:"pokecrys.gbc",link:"pokemon-crystal",img:"pokemon-crystal.jpg",name:"Pokemon Crystal",core:"gb",dev:"Nintendo, Game Freak",desc:"Originally released for the Game Boy\u2122 Color system in 2000, the Pok\xe9mon\u2122 Crystal game added several new features to the Pok\xe9mon franchise. \n    For the first time, players could choose a female or male character, Pok\xe9mon battles featured animation, and more. \n    And now, this Virtual Console release invites you to explore the Johto region again\u2014or for the first time.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["miscellaneous"],path:"mtl",link:"monkeytype-lite",img:"monkeytype-lite.png",name:"Monkeytype Lite",dev:"Miodec",desc:"A minimalistic, customisable typing website. Test yourself in various modes, track your progress and improve your typing speed. \n    Credits to Miodec for making Monkeytype and for VocalNutria for providing a codebase to start from.\n    Remade by r0cket to replicate some core features of Monkeytype.\n    For the best experience: https://monkeytype.com/",controls:["Type to interact"]},{filters:["fighting","strategy"],path:"aow2",link:"age-of-war-2",img:"aow2.png",name:"Age of War 2",dev:"Louissi",desc:"A terrible struggle is about to take place that will determine the future of your people. Only one possible solution to this conflict: to conquer or die! \n    Establish your strategy carefully, finding the right balance between attack and defense, and use your collected experience to upgrade your troops. \n    Age of War 2 is a great strategy / defense game, with easy handling but vast possibilities.",controls:["Click: Interact"]},{filters:["miscellaneous"],path:"fnf",link:"fnf",img:"fnf.png",name:"Friday Night Funkin",dev:"ninjamuffin99",desc:'Friday Night Funkin\' is an open-source donationware rhythm game first released in 2020 for a game jam. \n    The game was developed by a team of four Newgrounds users, Cameron "Ninjamuffin99" Taylor, David "PhantomArcade" Brown, Isaac "Kawai Sprite" Garcia, and evilsk8r.',controls:["WASD/Arrow Keys: Interact","+/-: Change volume"]},{filters:["platformer","flash"],path:"shift",link:"shift",img:"shift.png",name:"Shift",dev:"Antony Lavelle",desc:"Is the floor the roof? Is the roof the floor? And whats with that in game timer?\n    Find the answers to all the above questions and more in this original puzzle platformer!",controls:["Arrow Keys: Control movement","Space: Jump",'Shift: "Shift"',"P: Pause/Open menu",]},{filters:["platformer","flash"],path:"shift2",link:"shift-2",img:"shift-2.png",name:"Shift 2",dev:"Antony Lavelle",desc:"The sequel to The Shift! Is the floor the roof? Is the roof the floor? And whats with that in game timer?\n    Find the answers to all the above questions and more in this original puzzle platformer, part 2!",controls:["Arrow Keys: Control movement","Space: Jump",'Shift: "Shift"',"P: Pause/Open menu",]},{filters:["platformer","flash"],path:"pf",link:"portal-flash",img:"portal-flash.jpg",name:"Portal Flash",dev:"We Create Stuff",desc:"Portal: The Flash Version includes over 40 challenging, portals thinking levels, which features almost every feature the real game does, \n    in 2d - energy balls, cubes, turrets and even the famous crusher from the trailer. \n    The game also includes a console to mess around with after finishing the game, or just being frustrated by thinking with portals!",controls:["WAD: Control movement","Q: Open a blue portal","E: Open a yellow portal","R: Close portals","F: Pick up object","Esc/P: Pause game",]},{filters:["sports","unity"],path:"vg",link:"volley-gosh",img:"volleygosh.png",name:"Volley Gosh",dev:"Gerard Delaney and Scott Bartlett",desc:'Volley Gosh is a bright and happy ball game where you must try keep your "volley gosh ball" in the air for as long as possible. \n    Watch out for the increasing challenge and surprises that abound on the joyful beach while you get your next high score!',controls:["Arrow Keys: Control movement","Space: Hit the ball","Z: Dash",]},{filters:["platformer","miscellaneous","fighting"],path:"ud",link:"unfairdyne",img:"unfairdyne.jpg",name:"Unfair Dyne",dev:"Joe Zeng",desc:'Break the word in half and add "UN" to each part. Undyne fight, but harder. \n    \n    - If pressing Z doesn\'t work, try clicking near the edges and then pressing Z to play.',controls:["WASD/Arrow Keys: Control movement","Z: Proceed"]},{filters:["miscellaneous","puzzle"],path:"ms",link:"minesweeper",img:"minesweeper.png",name:"Minesweeper",dev:"PicturElements",desc:'Minesweeper is a single-player puzzle video game. The objective of the game is to clear a rectangular board containing hidden "mines" or bombs without detonating any of them, with help from clues about the number of neighboring mines in each field.',controls:["LMB: Reveal tile","RMB: Flag","Smiley Face: Reset game"]},{filters:["miscellaneous","mobile"],path:"stack",link:"stack",img:"stack.png",name:"Stack",dev:"Steve Gardner",desc:"Stack is a fun and simple game with a simple goal. Keep stacking up the blocks as high as you can! Just make sure you don't run out of blocks...",controls:["Click/Space: Place blocks"]},{filters:["miscellaneous","puzzle","mobile"],path:"linerider",link:"linerider",img:"linerider.jpg",name:"Line Rider",dev:"Emergent Studios",desc:"Line Rider is a classic sandbox game where you draw a track for the sledder to ride on. Simple concept, endless possibilities, oddly addicting!",controls:["Click and hold to draw"]},{filters:["miscellaneous"],path:"ast",link:"alphabet-speed-test",img:"alphabettest.png",name:"Alphabet Speed Test",dev:"Sindre",desc:"Alphabet Speed Test is a fun little game to check how quickly you can type the alphabet on your keyboard!",controls:["Type to interact"]},{filters:["driving","miscellaneous","unity"],path:"tanuki",link:"tanuki-sunset",img:"tanuki.png",name:"Tanuki Sunset",dev:"Rewind Games",desc:"Tanuki Sunset Classic is a third-person longboard-skating game where players play as a raccoon skating downhill on a procedurally generated synthwave-themed seaside road.\n\n    Drift your way around the narrow corners, gather Tanuki Bits to fill up your Bonus Roulette Meter and try and gather as many points as you can.\n    \n    Drift often. Get some air-time and avoid cars and obstacles while pushing your luck close to the walls and edges to get near-miss moments and tight-squeezes to maximize your score.\n    \n    Get the full game on Steam: https://store.steampowered.com/app/1251460/Tanuki_Sunset/",controls:["W: Speed Stance (Hold)","AD/\u2190/\u2192: Control movement","S: 180 Slide","Space: Drift","Esc: Pause",]},{filters:["puzzle","flash"],path:"tiq",link:"the-impossible-quiz",img:"tiq.png",name:"The Impossible Quiz",dev:"Splapp-me-do",desc:"The Impossible Quiz is an online quiz game that is\u2026 Almost impossible. The questions are all difficult to answer and require lateral thinking. \n    There are 110 questions to get through and you only have three lives, so make sure you\u2019re ready to think creatively! ",controls:["Click: Interact"]},{filters:["puzzle","flash"],path:"tiq2",link:"the-impossible-quiz-2",img:"tiq2.jpeg",name:"The Impossible Quiz 2",dev:"Splapp-me-do",desc:"The Impossible Quiz 2 is the second installment of the most annoying quiz on the internet. Although not entirely impossible, you must navigate through a series of illogical questions and hope to answer them correctly. \n    Each wrong answer costs you a life, so memorize your answers and try again to get further!",controls:["Click: Interact"]},{filters:["driving"],path:"motox3m",link:"motox3m",img:"motox3m.png",name:"Moto X3M",dev:"MadPuffers",desc:"Use the arrow keys to accelerate, brake, or flip your bike. Make it through the course as quickly as possible. Do stunts in the air to shave time off of your run!",controls:["WASD/Arrow Keys: Control movement"]},{filters:["platformer","flash"],path:"ltf",link:"learn-to-fly",img:"learntofly.png",name:"Learn To Fly",dev:"lightbringer777",desc:"One Penguin Takes it personally when he is surfing the web and stumbles upon a web site telling him that he cant fly, \n    after that he sets his mind to research and practice flying until he can prove the world that he can.. Learn to Fly!",controls:["\u2190/\u2192: Adjust angle","Space: Rockets"]},{filters:["shooting","platformer","flash"],path:"boi",link:"binding-of-isaac",img:"boi.png",name:"Binding of Isaac",dev:"Edmund McMillen, Florian Himsl",desc:"When Isaac\u2019s mother starts hearing the voice of God demanding a sacrifice be made to prove her faith, Isaac escapes into the basement facing droves of deranged enemies, lost brothers and sisters, his fears, and eventually his mother.\n    The Binding of Isaac is a randomly generated action RPG shooter with heavy Rogue-like elements. \n    Following Isaac on his journey players will find bizarre treasures that change Isaac\u2019s form giving him super human abilities and enabling him to fight off droves of mysterious creatures, discover secrets and fight his way to safety.\n    \n    Full version on Steam: https://store.steampowered.com/app/113200/The_Binding_of_Isaac/",controls:["WASD: Control movement","Arrow Keys: Control shooting"]},{filters:["emulator","shooting"],path:"doom.smc",link:"doom",img:"doom.png",name:"Doom",core:"snes",dev:"id Software, GT Interactive",desc:"Doom is a 1993 first-person shooter game developed by id Software. Players assume the role of a space marine, popularly known as Doomguy, fighting their way through hordes of invading demons from Hell.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","flash"],path:"ufs",link:"ultimate-flash-sonic",img:"ufsonic.png",name:"Ultimate Flash Sonic",dev:"Dennis-Gid",desc:"Ultimate Flash Sonic is a sonic fangame made in Adobe Flash. It was created by Dennis-Gid and it was uploaded to Newgrounds on Febuary 21, 2004.",controls:["WASD: Control movement","Arrow Keys: Control shooting"]},{filters:["platformer"],path:"jp",link:"jimothy-piggerton",img:"jimpig.png",name:"Jimothy Piggerton",dev:"Niborious7",desc:"Run and Jump to Save Piggerton from the deadly Butcher!",controls:["WASD/Arrow Keys: Control movement"]},{filters:["puzzle","platformer","flash"],path:"whg",link:"worlds-hardest-game",img:"whg.png",name:"World's Hardest Game",dev:"Stephen Critoph",desc:"This is the self-proclaimed World's Hardest Game. Don't play it; it's too difficult! It really is! Wow this game has to be one of the most challenging but addictive games ever to be made! \n    The aim is simple: all you have to do is guide your red block from one end of the level to the other and collect any yellow circles on the way. This might sound easy, but believe us when we say it isn't!",controls:["WASD/Arrow Keys: Control movement"]},{filters:["puzzle","platformer","flash"],path:"whg2",link:"worlds-hardest-game-2",img:"whg2.png",name:"World's Hardest Game 2",dev:"Stephen Critoph",desc:"World's Hardest Game 2 is the second episode of the self-proclaimed world's hardest game series! \n    Hone your reflexes and accuracy as you try to move your little block to the end of each stage without touching the obstacles. \n    Doing so will bring you back to the start so you can try again. \n    The difficulty goes up after every stage, so keep your focus and see how far you can get in the World's Hardest Game 2.",controls:["WASD/Arrow Keys: Control movement"]},{filters:["flash","miscellaneous"],path:"dw",link:"douchebag-workout",img:"dw.jpg",name:"Douchebag Workout",dev:"Pyrozen",desc:"Douchebag Workout is a button-mashing skill game where you level up by working out. You start as a skinny guy insecure about his body image. \n    The solution - get unnaturally large muscles and become a douchebag. Work all of your key muscle areas, buy supplements, and become the ripped chad you always imagined.",controls:["Click: Interact"]},{filters:["flash","miscellaneous"],path:"dw2",link:"douchebag-workout-2",img:"dw2.jpg",name:"Douchebag Workout 2",dev:"Pyrozen",desc:"Another Douche wanna be! Help this poor weak guy get into shape, start a social life, get some awesome swag to finally get with the ladies! \n    Do you have what it takes to become big, tanned and ripped? A hilarious game of upgrades and deep social exploration!",controls:["Click: Interact"]},{filters:["emulator","shooting"],path:"ge007.z64",link:"goldeneye-007",img:"ge007.png",name:"GoldenEye 007",core:"n64",dev:"Rare, Nintendo",desc:"GoldenEye 007 is a 1997 first-person shooter developed by Rare and published by Nintendo for the Nintendo 64.\n    Based on the 1995 James Bond film GoldenEye, the player controls the secret agent James Bond through a series of levels to prevent a criminal syndicate from using a satellite weapon.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["idle","miscellaneous"],path:"ib",link:"idle-breakout",img:"idle-breakout.png",name:"Idle Breakout",dev:"Kodiqi",desc:"Build the ultimate brick-busting machine to destroy billions of bricks. Idle breakout combines classic brick breaking with an insanely addicting idle loop.",controls:["Click: Interact"]},{filters:["restaurant","flash"],path:"ppiz",link:"papas-pizzeria",img:"ppiz.jpg",name:"Papa's Pizzeria",dev:"Flipline Studios",desc:"Papa's Pizzeria is back! Thanks to Ruffle you can now play Papa's Pizzeria for free in your web browser once again. Papa has spontaneously left town, leaving you in charge of the pizzeria. It's on you to take orders, add pizza toppings, put them in the oven, and cut the pizzas! Work fast and make Papa Louie proud.",controls:["Click: Interact"]},{filters:["flash","strategy"],path:"btd2",link:"btd2",img:"btd2.png",name:"Bloons Tower Defense 2",dev:"Ninja Kiwi",desc:"Bloons Tower Defense 2 is a popular tower defense game originally released in Flash by Ninja Kiwi. Strategically place your defenses, upgrade your units, and stop all balloons from passing through.",controls:["Click: Interact"]},{filters:["flash","miscellaneous"],path:"factoryballs2",link:"factoryballs2",img:"factoryballs2.png",name:"Factory Balls 2",dev:"bontegames",desc:"Factory Balls 2 is a puzzle game where your main task is to create balls that should match the ones being requested. At each level, you'll be shown a box with a label in front showing the type of ball that needs to be shipped. You'll then create a ball that looks exactly as the label using the balls on the left side of the screen and the different tools given to you (including paint, sticky tapes, belts, and other stuff). Some of the levels will require a bit of logic, so make sure you've got your thinking cap on!",controls:["Click: Interact"]},{filters:["flash","fighting"],path:"mr",link:"madness-regent",img:"mr.png",name:"Madness Regent",dev:"Krinkels",desc:"Madness Regent is a shooting game with platforming elements that lets you play as a cool dude as he guns down everything in his way. Survive through a gauntlet of enemies to activate the final boss so you can beat the stuffing out of him.",controls:["\u2190/\u2192: Control movement","\u2191: Aim upwards","S: Jump","A: Shoot",]},{filters:["flash","fighting"],path:"ma",link:"madness-accelerant",img:"ma.png",name:"Madness Accelerant",dev:"TomFulp",desc:"Madness Accelerant is a fast-paced action game to beat the enemies and escape the beast monster.\n\n    This game is a playable remake of Krinkel's Madness Consternation.",controls:["AD: Control movement","LMB: Attack","W: Jump","S: Swap weapons","Mouse: Aim",]},{filters:["flash","fighting"],path:"mh",link:"madness-hydraulic",img:"mh.png",name:"Madness Hydraulic",dev:"TomFulp",desc:"Madness Hydraulic is an arena shooting game that's part of the Madness series of games. This game has just as many insane weapons as any other in the series, but it also has a unique feature - hydraulic arenas. You have to try to survive through waves and waves of enemies by killing each enemy that spawns using any means necessary, like using their own guns, all of this while fighting in an arena that sometimes moves around due to the hydraulic mechanics.\n\n    Keep calm and pick up every gun, then shoot everything that moves in this crazy shooter, Madness Hydraulic.",controls:["AD: Control movement","A: Attack","S: Jump","D: Swap weapons","\u2191/\u2193: Aim","\u2190/\u2192: Walk",]},{filters:["unity","miscellaneous","platformer"],path:"hw",link:"happy-wheels",img:"hw.jpg",name:"Happy Wheels",dev:"Fancy Force",desc:"Happy Wheels is a side-scrolling, physics-based, obstacle course game with over a billion plays online and is now available for your mobile devices. Assume the role of your inadequately prepared racer and ignore severe consequences in a desperate search for victory. Keep in mind this is the demo version. The full version can be played at totaljerkface.com",controls:["WS/\u2191/\u2193: Accelerate/Decelerate","\u2190/\u2192: Lean forward/backwards","Space: Primary Action","Shift/Ctrl: Secondary Actions","Z: Eject",]},{filters:["platformer","emulator"],path:"pokehg.nds",link:"pokemon-heartgold",img:"pokemon-heartgold.jpg",name:"Pokemon HeartGold",core:"nds",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon HeartGold & SoulSilver are remakes of the original Gold & Silver games released in 1999 with further aspects which were introduced in Crystal in 2000. These games are set in the Johto & Kanto regions and were released in Japan in September 2009.\n\n    As these games are remakes of Gold & Silver, they will feature both Johto & Kanto and follow the storyline of you as a new trainer, going through the gyms of Johto and Kanto, and winding up needing to thwart a Team Rocket plot to takeover the world with their Pok\xe9mon.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokess.nds",link:"pokemon-soulsilver",img:"pokemon-soulsilver.jpg",name:"Pokemon SoulSilver",core:"nds",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon HeartGold & SoulSilver are remakes of the original Gold & Silver games released in 1999 with further aspects which were introduced in Crystal in 2000. These games are set in the Johto & Kanto regions and were released in Japan in September 2009.\n\n    As these games are remakes of Gold & Silver, they will feature both Johto & Kanto and follow the storyline of you as a new trainer, going through the gyms of Johto and Kanto, and winding up needing to thwart a Team Rocket plot to takeover the world with their Pok\xe9mon.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokeplat.nds",link:"pokemon-platinum",img:"pokemon-platinum.jpg",name:"Pokemon Platinum",core:"nds",dev:"Nintendo, Game Freak",desc:"Pok\xe9mon Platinum features a new story full of adventure, never-before-seen forms of powerful Pok\xe9mon--including the legendary Giratina's Origin Forme--and the Distortion World, a mysterious new world that suddenly appears in the Sinnoh region.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokediam.nds",link:"pokemon-diamond",img:"pokemon-diamond.jpg",name:"Pokemon Diamond",core:"nds",dev:"Nintendo, Game Freak",desc:"Bringing 107 New Pok\xe9mon into the mix, bringing us to a total of 493 Pok\xe9mon, including many evolutions of old Pok\xe9mon, Diamond & Pearl completely overhauls the battling system. No longer are move's stats based on its type , but rather each move is individually allocated being Physical or Special.\n\n    Diamond & Pearl are set in the far off land of Sinnoh and have you playing as a Rookie trainer wanting to go through Sinnoh, beat the Gyms and become the best trainer. However, throughout your travels, you will encounter two rivals as well as the evil Team of the land; Team Galactic, whom are bent on obtaining the special legendary of your version.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"pokepearl.nds",link:"pokemon-pearl",img:"pokemon-pearl.jpg",name:"Pokemon Pearl",core:"nds",dev:"Nintendo, Game Freak",desc:"Bringing 107 New Pok\xe9mon into the mix, bringing us to a total of 493 Pok\xe9mon, including many evolutions of old Pok\xe9mon, Diamond & Pearl completely overhauls the battling system. No longer are move's stats based on its type , but rather each move is individually allocated being Physical or Special.\n\n    Diamond & Pearl are set in the far off land of Sinnoh and have you playing as a Rookie trainer wanting to go through Sinnoh, beat the Gyms and become the best trainer. However, throughout your travels, you will encounter two rivals as well as the evil Team of the land; Team Galactic, whom are bent on obtaining the special legendary of your version.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["driving","unity"],path:"dh",link:"drift-hunters",img:"dh.png",name:"Drift Hunters",dev:"Ilya Kaminetsky",desc:"Drift Hunters is an awesome 3D car driving game in which you score points by drifting various cars.\n    These points earn you money, that you can spend to upgrade your current car or buy a new one.\n    The game stands out because of its realistic drifting physics and its various driving environments.",controls:["WASD: Control movement","Space: Hand brake","C: Change camera","Left Shift: Shift up gear","Left Ctrl: Shift down gear",]},{filters:["platformer","emulator"],path:"papermario.z64",link:"paper-mario",img:"papermario.jpg",name:"Paper Mario",core:"n64",dev:"Nintendo, Intelligent Systems",desc:"Mario pals around in an all-new action adventure! Mario's back in his first adventure since Super Mario 64, and this time, Bowser's bent on preventing a storybook ending. When Princess Peach is kidnapped, Mario plots to rescue the seven Star Spirits and rid the Mushroom Kingdom of Koopa's cruel cohorts. As he travels from the tropical jungles of Lavalava Island to the frosty heights of Shiver Mountain, he'll meet up with seven all-new companions... and he'll need help from each one or there'll be no happily ever after.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["idle","miscellaneous","mobile"],path:"dogeminer",link:"dogeminer",img:"dogeminer.jpg",name:"Dogeminer",dev:"rkn",desc:"Dogeminer is an awesome incremental game featuring our favorite dog. It is an idle game inspired by Cookie Clicker and uses the famous Doge meme featuring Shiba Inus. The goal of the game is to click your way to the moon.",controls:["Click: Interact"]},{filters:["idle","miscellaneous"],path:"csgo-clicker",link:"csgo-clicker",img:"csgoclicker.png",name:"CSGO Clicker",dev:"bnned",desc:"A CSGO based incremental game.",controls:["Click: Interact"]},{filters:["strategy","puzzle"],path:"chess",link:"chess",img:"chess.png",name:"Chess",dev:"kbjorklu",desc:"This program is a JavaScript implementation of the board game Chess, with a computer player opponent. All move types are supported, including en passant, castling and promotion.",controls:["Click: Interact"]},{filters:["platformer","emulator"],path:"dbzlog.gba",link:"dbzlog",img:"dbzlog.jpg",name:"Dragon Ball Z - The Legacy of Goku",core:"gba",dev:"Webfoot Technologies, Shadows in Darkness, Inc.",desc:"Bringing 107 New Pok\xe9mon into the mix, bringing us to a total of 493 Pok\xe9mon, including many evolutions of old Pok\xe9mon, Diamond & Pearl completely overhauls the battling system. No longer are move's stats based on its type , but rather each move is individually allocated being Physical or Special.\n\n    Diamond & Pearl are set in the far off land of Sinnoh and have you playing as a Rookie trainer wanting to go through Sinnoh, beat the Gyms and become the best trainer. However, throughout your travels, you will encounter two rivals as well as the evil Team of the land; Team Galactic, whom are bent on obtaining the special legendary of your version.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["flash","miscellaneous"],path:"oiligarchy",link:"oiligarchy",img:"oiligarchy.jpg",name:"Oiligarchy",dev:"Molleindustria",desc:"Oiligraphy is a free strategic tycoon game where you run you use government resources to drill for oil. Play this interesting time-management game that relies on politics to be able to progress. Trash the environment, displace endangered animals, and take advantage of indigenous people. Do so by bribing politicians to pass legislation that benefits your business. You can also bribe the government of different regions to get rid of protestors or let you pollute their environment. This is a tycoon game that\u2019s all about the profits and not about the people and animals you may hurt along the way. Don't feel rich enough? Then Drill, Baby, Drill!",controls:["Arrow Keys: Control movement","Space: Use item"]},{filters:["flash","shooting","fighting"],path:"skullkid",link:"skullkid",img:"skullkid.png",name:"The Skull Kid",dev:"Chance",desc:"The Skull Kid is a violent side scrolling action game that lets you play as the infamous Skull Kid and his huge chainsaw. There's only one way to play this game, and that's to destroy everything in your way. It's easy, it's violent, and it's pure, gory fun.",controls:["Arrow Keys: Control movement","Space: Use item"]},{filters:["flash","fighting"],path:"hobo",link:"hobo",img:"hobo.png",name:"Hobo",dev:"SeethingSwarm",desc:"Hobo is the first fighting game in the Hobo series. Go around the streets randomly starting fights using various combo moves. Use your low socioeconomic status as a weapon by punching and puking on all who stand in your way.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo2",link:"hobo-2",img:"hobo2.png",name:"Hobo 2",dev:"SeethingSwarm",desc:"Hobo 2 is the fantastic sequel to the popular original title \u2013 this time you must fight inside a deadly prison against your cell mates. Our hobo wants to rampage through the prison and escape to freedom \u2013 he wants to smash his way to the outside and cause as much damage and mayhem as possible.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo3",link:"hobo-3",img:"hobo3.png",name:"Hobo 3",dev:"SeethingSwarm",desc:"Hobo 3 is the third fighting game in the Hobo series. Go around the streets randomly starting fights using various combo moves. Use your low socioeconomic status as a weapon by punching and puking on all who stand in your way.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo4",link:"hobo-4",img:"hobo4.png",name:"Hobo 4",dev:"SeethingSwarm",desc:"Hobo 4 is a game where you control a hobo and fight the army. Punch them, kick them, and loot their weapon.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo5",link:"hobo-5",img:"hobo5.png",name:"Hobo 5",dev:"SeethingSwarm",desc:"Hobo 5 is a game where you play as a hobo who tries to escape from the alien's abduction. Fight with the aliens by kicking and punching them!",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo6",link:"hobo-6",img:"hobo6.png",name:"Hobo 6",dev:"SeethingSwarm",desc:"Hobo 6 is subtitled Hell, and that is what you can expect in this game. Hobo has left earth for hell and is now facing demons and Satan himself.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["flash","fighting"],path:"hobo7",link:"hobo-7",img:"hobo7.png",name:"Hobo 7",dev:"SeethingSwarm",desc:"No lazy hobos allowed in Heaven! Hobo must kick and punch his way in, pulling off combos with the keyboard for disgusting special moves.",controls:["Arrow Keys; Control movement","A: Punch/Pick up objects","S: Kick",]},{filters:["miscellaneous","puzzle","mobile"],path:"2048-alphabet",link:"2048-alphabet",img:"2048-alphabet.png",name:"2048 Alphabet",dev:"Viktor Dmitriyev",desc:"2048 Alphabet is a single-player sliding block puzzle game based off of 2048. When two tiles with the same letter touch, they merge into one!",controls:["WASD/Arrow Keys: Move tiles","R: Restart"]},{filters:["miscellaneous","puzzle","mobile"],path:"getmit",link:"getmit",img:"getmit.jpg",name:"GetMIT",dev:"Mitchell Gu",desc:"GetMIT is a single-player sliding block puzzle game based off of 2048. Combine other colleges to reach the almighty MIT!",controls:["WASD/Arrow Keys: Move tiles","R: Restart"]},{filters:["miscellaneous","puzzle","mobile"],path:"cupcake2048",link:"cupcake2048",img:"cupcake2048.jpg",name:"Cupcake2048",dev:"0x0800",desc:"Cupcake2048 is a single-player sliding block puzzle game based off of 2048. When two tiles with the same cupcake touch, they merge into one!",controls:["WASD/Arrow Keys: Move tiles","R: Restart"]},{filters:["miscellaneous","puzzle","mobile"],path:"9007199254740992",link:"9007199254740992",img:"9007199254740992.png",name:"9007199254740992",dev:"JamesQAQ",desc:"9007199254740992 is a single-player sliding block puzzle game based off of 2048. When two tiles with the same number touch, they merge into one!",controls:["WASD/Arrow Keys: Move tiles","R: Restart"]},{filters:["shooting","mobile"],path:"ztype",link:"ztype",img:"ztype.png",name:"ZType",dev:"Dominic Szablewski",desc:"Fend of the enemy's attack waves by proving your typing skills. Each letter you type shoots off a powerful plasma bullet into the enemy's ships. If you ever find yourself in a dire situation, you can use the EMP bombs to destory any nearby enemies.",controls:["Type to interact"]},{filters:["shooting","mobile"],path:"x-type",link:"x-type",img:"x-type.png",name:"X-Type",dev:"Dominic Szablewski",desc:"X-Type is a crazy space Shoot'em'Up with endless boss battles. Each time you defeat a boss, the next one will come back even bigger and meaner. You have to evade hundreds of bullets while taking out the enemy part by part.",controls:["WASD/Arrow Keys: Control movement","Mouse: Shoot"]},{filters:["miscellaneous","mobile","strategy","unity"],path:"bitlife",link:"bitlife",img:"bitlife.png",name:"BitLife",dev:"Candywriter",desc:"BitLife is a simulator where you will be making important decisions about your life that will influence its course. For instance, you can get married with the love of your life, have kids and get a great education. You can also pick some options that will frankly scare your parents, but hey, maybe they\u2019ll be fun? You can become a criminal mastermind, fall in love or start chasing adventure, lead a prison riot, smuggle bags of drugs or cheat on your partner. You pick your own story. Interactive story games are on the market for a long time, but this is the first text based life simulator that will be able to simulate the story well enough!",controls:["Click: Interact"]},{filters:["sports","flash"],path:"baseball",link:"baseball",img:"baseball.png",name:"Baseball",dev:"Luke Whittaker",desc:"Baseball is a sports game that lets you experience being part of the great American pastime as a batter, all in the comfort of your browser! There are 2 modes available to play, and both of them are just as fun as the other.",controls:["Click: Interact"]},{filters:["puzzle","platformer","flash"],path:"au",link:"achievement-unlocked",img:"au.jpg",name:"Achievement Unlocked",dev:"Jmtb02",desc:"Achievement Unlocked is a fun game where you do random tasks that have nothing to do with anything. Try to explore everything to unlock every achievement possible.",controls:["WASD: Control movement"]},{filters:["puzzle","strategy"],path:"ctrtr",link:"ctrtr",img:"ctrtr.jpg",name:"Cut the Rope: Time Travel",dev:"ZeptoLab",desc:"Join Om Nom as he travels back in time to feed his ancestors with candy. Cut the Rope: Time Travel is a completely new adventure filled with time-traveling, candy-crunching, physics-based action.",controls:["Click: Interact"]},{filters:["platformer","flash"],path:"shift3",link:"shift-3",img:"shift-3.jpg",name:"Shift 3",dev:"Antony Lavelle",desc:"You asked for it, you got it. SHIFT 3 is here, and it's unlike any Shifting experience you've had before. A massive Adventure mode takes you to the roots of the SHIFT experiment, tonnes of achievements to earn and even an unlockable Celebrity secret character! And if that isn't your cup of tea, theres a selection of 18 Classic style levels from Shift players around the globe to battle your way through, and highscore boards all around! Have fun, this is SHIFT 3, and I made it just for you.",controls:["Arrow Keys: Control movement","Space: Jump",'Shift: "Shift"',"P: Pause/Open menu",]},{filters:["strategy"],path:"amongus",link:"amongus-fangame",img:"amongus.jpg",name:"Among Us Fan Game",dev:"Klopity",desc:"A fan-made single player Among Us clone. Play as the killer and try to win the game without being caught.",controls:["WASD/Arrow Keys: Control movement","Click: Interact"]},{filters:["fighting","flash"],path:"portaldefenders",link:"portal-defenders",img:"portaldefenders.png",name:"Portal Defenders",dev:"Luis and Bomtoons",desc:"Portal Defenders is an action game where you beat up your enemies who get out from the portal gate. Kill them and eat their organs to get more energy.",controls:["Arrow Keys: Control movement","A: Attack","S: Jump","D: Bomb","P: Pause/Open menu",]},{filters:["strategy","flash","shooting","multiplayer"],path:"artillery",link:"artillery",img:"artillery.png",name:"Artillery Live",dev:"T. Suriyathep",desc:"Artillery is a tank battle game where you use various tactics to shoot down your tank opponents. Move your tank, decide how powerful your weapon will shoot, and decide how many degrees the thank should point to the other side.",controls:["Click: Interact"]},{filters:["strategy","flash"],path:"rcc",link:"rollercoaster-creator",img:"rcc.png",name:"Rollercoaster Creator",dev:"GamesGames",desc:"ln Rollercoaster Creator, you are tasked in creating rollercoasters that people will enjoy while making money for the owner. Go through different levels and test your wit as you get more tools and money becomes harder to get while riders become harder to satisfy.\n    If you think you have what it takes to be a world renowned rollercoaster builder, give Rollercoaster Creator a shot.",controls:["Click: Interact"]},{filters:["strategy","shooting","flash","multiplayer"],path:"bowman",link:"bowman",img:"bowman.png",name:"Bowman",dev:"FreeWorldGroup",desc:"Bowman is an archery game where you and an opponent take shots at each other. You win when you\u2019ve hit the opponent fatally. It can take a few arrows. Bowman can be played against the computer or via local multiplayer.",controls:["Click: Interact"]},{filters:["strategy","shooting","flash","multiplayer"],path:"bowman2",link:"bowman2",img:"bowman2.png",name:"Bowman 2",dev:"FreeWorldGroup",desc:"Become a master of archery in Bowman 2! You need to define the shooting angle and aim carefully. Your mission is to eliminate the opponent by successfully hitting them. Have fun!",controls:["Click: Interact"]},{filters:["flash","shooting"],path:"bpp1",link:"bpp1",img:"bpp1.jpg",name:"Bloons Player Pack 1",dev:"Ninja Kiwi",desc:"Bloons Player Pack 1 is a fun arcade game where you must help the monkey to pop all the balloons with its darts.",controls:["Click: Interact"]},{filters:["flash","fighting"],path:"sonny",link:"sonny",img:"sonny.png",name:"Sonny",dev:"Krinn",desc:"Dear Human, \n    Zombies. You've shot them, stabbed them, sliced and diced them. Today I put you in the shoes of a Zombie. Fight for your life in this crazy and twisted world.",controls:["Click: Interact"]},{filters:["flash","fighting"],path:"sonny2",link:"sonny2",img:"sonny2.png",name:"Sonny 2",dev:"Krinn",desc:"Sonny 2 is a combat based RPG where you play as a Zombie, level up and gain items to advance to the next Zone.",controls:["Click: Interact"]},{filters:["platformer","mobile"],path:"jj",link:"jetpack-joyride",img:"jj.jpg",name:"Jetpack Joyride",dev:"Halfbrick Studios",desc:"Jetpack Joyride is a fast-paced action game where you will be flying through the air with a jetpack. You will be dodging lasers, avoiding missiles and collecting coins. You can also use the coins to buy new jetpacks, suits and other cool stuff. The game is very addictive and you will be playing it for hours. The game is also available for Android and iOS devices.",controls:["Click: Interact"]},{filters:["flash","sports"],path:"afl",link:"axis-football-league",img:"afl.jpg",name:"Axis Football League",dev:"Axis Games",desc:"Axis Football League is a fun and fast-paced American Football game in which you can compete in various football matches and leagues. Choose from a range of different AFL teams including the San Diego Storm, New England Volunteers an the New York Rockets - each team has different stats and excels at different areas of football such as passing, blocking and rushing.",controls:["WASD: Control movement","Click: Change player","Space: Kick"]},{filters:["flash","driving"],path:"db",link:"dune-buggy",img:"db.png",name:"Dune Buggy",dev:"Iriysoft",desc:"Dune Buggy is a classic side-scrolling driving game. Drive your buggy without crashing all the way to the finish line! Collect stars along the way, but make sure to avoid the skulls! This side-scrolling driving game features difficult offroad tracks, high-speed ramps, and crazy loops. Have fun!",controls:["Arrow Keys: Control movement","Space: Jump"]},{filters:["miscellaneous","strategy","flash"],path:"dond",link:"deal-or-no-deal",img:"dond.png",name:"Deal or No Deal",dev:"iWin",desc:"The popular TV program is here in a flash version. Win as much money as you can and be ready to overcome some difficulties. At the beginning, you choose one briefcase. You will gradually open the others and the goal is to open the briefcases with the lowest value. After a few openings, the banker will call you and give you an offer. Since you don't know what's in your briefcase, you have to think about whether to take the offer or risk opening more briefcases. It's up to you, so good luck.",controls:["Click: Interact"]},{filters:["idle","fighting","flash"],path:"clickermonsters",link:"clicker-monsters",img:"clickermonsters.jpg",name:"Clicker Monsters",dev:"GamesButler",desc:"In Clicker Monsters you have to click and defeat some evil monsters. By doing so, you can collect gold which you can use to upgrade your equipment. That way, you can defeat even more monsters! Use your mouse to play this fun clicker game.",controls:["Click: Interact"]},{filters:["shooting","flash"],path:"bowmasterprelude",link:"bowmaster-prelude",img:"bowmasterprelude.png",name:"Bowmaster Prelude",dev:"Jason Reinsvold",desc:"Bowmaster Prelude is one of the original browser games and was released over 10 years ago! This title is still as awesome as it was back then and the gameplay is addictive and fun. You must defend your castle from waves of incoming enemies and also try to attack the enemy castle. You control a brave Bowmaster and you must manually fire arrows at the incoming knights and warriors. Take into consideration the angle and power of your bow shots and also the movement of the enemies.",controls:["Click: Interact"]},{filters:["shooting","flash"],path:"bowmaster",link:"bowmaster",img:"bowmaster.png",name:"Bowmaster",dev:"Jason Reinsvold",desc:"In Bowmaster, you need to aim your bow and take down all the incoming enemies with your mighty arrows.",controls:["Click: Interact"]},{filters:["fighting","flash"],path:"boxing",link:"boxing",img:"boxing.png",name:"Boxing",dev:"GAMEDESIGN",desc:"Boxing is a sports game that is simply about boxing and punching the living daylights out of your opponent. Create your own boxer with randomized stats (you can keep making one until you're happy with what you've got) and fight your way to the top. You'll be starting off as top 100, but each boxer you defeat will take you up the ladder. Get the top spot and take the fame and fortune that you deserve in Boxing!",controls:["\u2191: Uppercut","\u2193: Bodyshot","\u2190: Jab","\u2192: Cross","Space: Hook",]},{filters:["emulator","fighting"],path:"oot.z64",link:"ocarina-of-time",img:"oot.jpeg",core:"n64",name:"The Legend of Zelda: Ocarina of Time",dev:"Nintendo",desc:"Journey through the land of Hyrule in the Nintendo 64's first installment in the Zelda universe, Legend of Zelda: The Ocarina of Time.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["platformer","emulator"],path:"mlss.gba",link:"mario-luigi-superstar-saga",img:"mlss.jpeg",name:"Mario & Luigi - Superstar Saga",core:"gba",dev:"Alpha Dream,  Vanpool",desc:"An evil witch has replaced Princess Peach's fair speech with explosives! Mario and Luigi must once again come to her rescue, but this time they employ the help of Bowser, their sworn enemy. Mario and Luigi must learn new moves and combine powers to fight off enemies and move closer to the witch's castle.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["emulator","sports"],path:"tecmobowl.nes",link:"tecmo-bowl",img:"tecmobowl.jpeg",name:"Tecmo Bowl",core:"nes",dev:"Tecmo",desc:"Tecmo Bowl is an American football arcade game developed and released by Tecmo in 1987. The game was both successful in the arcades, and as a 1989 port for the Nintendo Entertainment System. The NES version was the first console game to feature real NFL players.",controls:["Enter: Start/Pause","Arrow Keys: Control movement","Hover and click the gamepad icon to view/change controls.",]},{filters:["flash","restauraunt"],path:"papasburgeria",link:"papas-burgeria",img:"papasburgeria.png",name:"Papa's Burgeria",dev:"Flipline Studios",desc:"In this sequel to the award-winning hit game \u201CPapa\u2019s Pizzeria\u201D, you\u2019re headed back to the kitchen to run Papa Louie\u2019s new burger shop! New customers and old favorites will visit the Burgeria, and you\u2019ll have to take orders, grill burgers, add toppings, and serve the sandwiches to the waiting customers.\n\n    Visit the new Upgrade Shop at the end of each day, where you can spend your hard-earned tips on a number of helpful items, including a door chime, grill timers, a heat lamp, and various decorations to help improve your score.",controls:["Click: Interact"]},{filters:["flash","strategy","fighting"],path:"jacksmith",link:"jacksmith",img:"jacksmith.png",name:"Jacksmith",dev:"Flipline Studios",desc:"Man the forge and craft your best weapons for your warriors in Jacksmith! You\u2019re a donkey on a mission that takes you across the land, but the trails are blocked by a variety of monsters \u2014 time to call in the local warrior clans for help! You\u2019ll design swords, bows, shields, and other weapons in a completely hands-on blacksmith shop. When all of your soldiers are equipped, it\u2019s off to battle to fight your way further down the path! While the warriors fight, you\u2019ll need to gather loot and help out with your trusty cannon. Collect better ores and parts to make even better weapons, and keep making progress across the land towards the evil wizard Dudley!",controls:["Click: Interact"]},{filters:["flash","strategy"],path:"btd3",link:"btd3",img:"btd3.jpg",name:"Bloons Tower Defense 3",dev:"Ninja Kiwi",desc:"Bloons Tower Defense 3 is a fun tower defense game in which you are once again entrusted with defending your headquarters with the aid of dart-throwing monkeys. Balloons are coming to take over your home! Place them strategically along the winding track the baloons will travel. Upgrade them as necessary, increasing range and frequency of their dart throwing.",controls:["Click: Interact"]},{filters:["flash","miscellaneous"],path:"diggy",link:"diggy",img:"diggy.png",name:"Diggy",dev:"Vogd & Assaulter",desc:"Go on a digging quest and make it to the center of planet Earth! Buy upgrades to dig quicker and more efficiently. Good luck! Diggy is a fun digging game in which you need to dig as deep as possible and find many hidden treasures. To dig, you need to shoot the drill, but it consumes energy. You can also use radar to find the nearby valuables. Try to get as many treasures as you can before the energy runs out. Some layers of soil are harder than others and require more shoots. After the energy runs out, the day is over, and you have the chance to buy various upgrades to dig longer in the next day. Repeat and go as deep as possible!",controls:["WASD/Arrow Keys: Control movement","E: Use radar","Click: Dig",]},]}}])